import React from 'react'

import AppLayout from "../components/app-layout";
import Contact from "../components/contact";

const Page = () => (
  <AppLayout className='App Homepage'>
    <HeaderContainer displaySearch={true} />
    <Contact />
  </AppLayout>
);

export default Page;
